import React, { Component } from 'react'
import Chip from '@material-ui/core/Chip';
import './style.css';

export default class Preference extends Component {


  constructor(props) {
    super(props);
    this.state = {
      prefer_1 : '',
      prefer_2 : [],
      prefer_3 : [],
      prefer_4 : '',
      prefer_5 : ''
    }
  }

  render() {

    function prefer1(value) {
      console(value);
      this.setState({
        prefer_1 : value
      });
    }

    function prefer2(value) {
      console(value);
    }

    function prefer3(value) {
      console(value);
    }

    function prefer4(value) {
      console(value);
    }

    function prefer5(value) {
      console(value);
    }

    return (
      <div className="preference-wrapper">
        <div className="preference-1">
          <h1 className="about-u">Tell Us About Yourself</h1>

          <Chip label="Male"
                className="chips"
                color="primary"
                onClick={ () => prefer1('male') }
          />
          <Chip label="Female"
                className="chips"
                color="secondary"
                onClick={ () => prefer1('female') }
          />

        </div>

        <div className="preference-2">
          <h1 className="about-u">Tell Us Where You Are</h1>

          <Chip label="Pub"
                className="chips"
                color="primary"
                onClick={ () => prefer2('pub') }

          />

          <Chip label="Bar"
                className="chips"
                color="primary"
                onClick={ () => prefer2('bar') }

          />

          <Chip label="Your House"
                className="chips"
                color="primary"
                onClick={ () => prefer2('ur_house') }
          />

          <Chip label="Your Friend's House"
                className="chips"
                color="primary"
                onClick={ () => prefer2('ur_frnd_house') }
          />

          <Chip label="Outdoor"
                className="chips"
                color="primary"
                onClick={ () => prefer2('outdoor') }

          />

          <Chip label="Professional Premise"
                className="chips"
                color="primary"
                onClick={ () => prefer2('professonal_space') }

          />

        </div>

        <div className="preference-3">
          <h1 className="about-u">Whom you are with</h1>

          <Chip label="Casual Friends"
                className="chips"
                color="primary"
                onClick={ () => prefer3('cas_frnds') }

          />
          <Chip label="Professional Friend"
                className="chips"
                color="primary"
                onClick={ () => prefer3('prof_frnds') }

          />
          <Chip label="Colleagues"
                className="chips"
                color="primary"
                onClick={ () => prefer3('colleagues') }

          />
          <Chip label="Strangers"
                className="chips"
                color="primary"
                onClick={ () => prefer3('strangers') }

          />
          <Chip label="Newly Met"
                className="chips"
                color="primary"
                onClick={ () => prefer3('newly_met') }

          />
          <Chip label="Close Friends"
                className="chips"
                color="primary"
                onClick={ () => prefer3('close_frnds') }

          />

        </div>

        <div className="preference-4">
          <h1 className="about-u">How Drunk You Want To Be</h1>

          <Chip label="Sober"
                className="chips"
                color="primary"
                onClick={ () => prefer4('sober') }

          />
          <Chip label="Casual"
                className="chips"
                color="primary"
                onClick={ () => prefer4('casual') }

          />
          <Chip label="Wild"
                className="chips"
                color="primary"
                onClick={ () => prefer4('wild') }

          />         

        </div>


        <div className="preference-5">
          <h1 className="about-u">What Time Of Day It Is</h1>

          <Chip label="Blue Sky"
                className="chips"
                color="primary"
                onClick={ () => prefer5('blue_sky') }

          />
          <Chip label="Moonlight"
                className="chips"
                color="primary" 
                onClick={ () => prefer5('moonlight') }

          />         

        </div>
      </div>
    )
  }
}
